import React from 'react';
import { Text, HStack, CheckboxGroup } from "@chakra-ui/react"
/**************************************************** */

import { Checkbox } from "../style_compomemts/checkbox"


/***************************************************************/
export function TypesSelection(props) {
    return (
        <HStack spacing={2}>
            <Text>Select types :</Text>
            <CheckboxGroup>
                <HStack spacing={4}>
                    <Checkbox value="creatrue" displayLabel="Creatrue" setValue={(value) => props.setTypes(value)}/>
                    <Checkbox value="artifact" displayLabel="Artifact" setValue={(value) => props.setTypes(value)}/>
                    <Checkbox value="enchantment" displayLabel="Enchantment" setValue={(value) => props.setTypes(value)}/>
                    <Checkbox value="planeswalker" displayLabel="Planeswalker" setValue={(value) => props.setTypes(value)}/>
                    <Checkbox value="instant" displayLabel="Instant" setValue={(value) => props.setTypes(value)}/>
                    <Checkbox value="sorcery" displayLabel="Sorcery" setValue={(value) => props.setTypes(value)}/>
                    <Checkbox value="land" displayLabel="Land" setValue={(value) => props.setTypes(value)}/>
                    <Checkbox value="tribal" displayLabel="Tribal" setValue={(value) => props.setTypes(value)}/>
                </HStack>
            </CheckboxGroup>
         </HStack>
    );
}
